// src/App.js
import { useState } from "react";

function Project({ setCurrentPage }) {
  console.log('Rendering Project');
  return (
    <div>
      <h2>Projects</h2>
      <p>Project list would go here.</p>
      <button onClick={() => setCurrentPage('home')}>Back</button>
    </div>
  );
}

function AnalyticsDashboard({ setCurrentPage }) {
  console.log('Rendering AnalyticsDashboard');
  return (
    <div>
      <h2>Analytics</h2>
      <p>Analytics overview would go here.</p>
      <button onClick={() => setCurrentPage('home')}>Back</button>
    </div>
  );
}

function Home({ setCurrentPage }) {
  console.log('Rendering Home');
  return (
    <div>
      <h1>Jira Project Management</h1>
      <button onClick={() => setCurrentPage('projects')}>
        View Projects
      </button>
      <button onClick={() => setCurrentPage('analytics')}>
        View Analytics
      </button>
    </div>
  );
}

export default function App() {
  console.log('Rendering App');
  const [currentPage, setCurrentPage] = useState('home');

  return (
    <div>
      {currentPage === 'home' && <Home setCurrentPage={setCurrentPage} />}
      {currentPage === 'projects' && <Project setCurrentPage={setCurrentPage} />}
      {currentPage === 'analytics' && <AnalyticsDashboard setCurrentPage={setCurrentPage} />}
    </div>
  );
}
